#include <sstream>
#include <algorithm>
#include <set>
#include "../check/CheckResult.h"

using namespace std;

class Solution {
public:
    vector<int> countSmaller(vector<int>& nums) {
        /* 从后往前升序排列nums[i]，每一次排序，考察的就是从nums[i]到nums[end]这个数组中，nums[i]应该排在什么位置，
           也就是说nums[i]在新数组中的下标就是原数组中nums[i]右侧有几个数小于它 */
        multiset<int> sortNums;
        vector<int> sortIndexs;
        int i, size = nums.size();

        for (i = size - 1; i >= 0; i--) {
            auto iter = sortNums.find(nums[i]);
            if (iter != sortNums.end()) {
                sortIndexs.push_back(distance(sortNums.begin(), iter));
                sortNums.insert(nums[i]);
            }
            else {
                iter = sortNums.insert(nums[i]);
                sortIndexs.push_back(distance(sortNums.begin(), iter));
            }
        }

        reverse(sortIndexs.begin(), sortIndexs.end());
        return sortIndexs;
    }
};

